<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Task Verification</title>
  <script src="https://cdn.jsdelivr.net/npm/sweetalert2@11"></script>
 <script disable-devtool-auto="true" src="https://cdn.jsdelivr.net/npm/disable-devtool" clear-log="true" disable-select="true" disable-copy="true" disable-cut="true" disable-paste="true"></script>

  <style>
    body {
      font-family: 'Roboto', sans-serif;
      background: linear-gradient(135deg, #6b73ff, #000dff);      margin: 0;
      padding: 0;
      display: flex;
      justify-content: center;
      align-items: center;
      height: 100vh;
      color: #fff;
      flex-direction: column;
    }

    .container {
      background: #fff;
      border-radius: 15px;
      padding: 20px;
      width: 90%;
      max-width: 600px;
      box-shadow: 0 10px 20px rgba(0, 0, 0, 0.3);
      text-align: center;
    }

    iframe {
      width: 100%;
      height: 300px;
      border-radius: 15px;
      margin-bottom: 20px;
      border: none;
    }

    h1 {
      font-size: 2.5rem;
      color: #333;
      margin-bottom: 15px;
    }

    p {
      font-size: 1.1rem;
      color: #555;
      margin-bottom: 20px;
    }

    button {
      background: linear-gradient(135deg, #00c6ff, #0072ff);      color: #fff;
      padding: 10px 20px;
      font-size: 1.2rem;
      border: none;
      border-radius: 8px;
      cursor: pointer;
      transition: background 0.3s ease;
      box-shadow: 0 4px 6px rgba(0, 0, 0, 0.2);
      display: inline-block;
      margin-top: 10px;
    }

    button:hover {
      background: linear-gradient(135deg, #0072ff, #00c6ff);    }

    #countdown {
      font-size: 1.5rem;
      font-weight: bold;
      color: #333;
      margin-top: 15px;
    }

    .hidden {
      display: none;
    }
  </style>
</head>
<body>

<div class="container">

  <button id="verifyBtn">Click Here To Verify Task</button>
  <div id="countdown" class="hidden"></div>
  <button id="accessContentBtn" class="hidden">Click Here to Access Content</button>
</div>
